import Logo from "../components/logo";
import React from "react";
import "../design/Home.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Contact from "./contact";

export default class Sidebar extends React.Component {
  render() {
    return (
      <div className="col-md-3 graySidebar d-flex flex-column justify-content-between">
        <Logo />
        <div
          className="container text-center"
          style={{
            position: "absolute",
            top: "25%",
            height: "75%"
          }}
        >
          <div className="cover_pic">
            {" "}
            <img
              src="https://image.flaticon.com/icons/svg/168/168882.svg"
              style={{
                height: "45%",
                width: "45%",
                borderSpacing: "5px",
                marginBottom: "10%"
              }}
            ></img>
          </div>
          <div className="name">
            <h1 style={{ fontSize: "50px" }}>
              <span className="Jayansh">Jayansh</span>
            </h1>
            <h1 style={{ fontSize: "50px" }}>
              <span className="Bhartiya">Bhartiya</span>
            </h1>
          </div>
        </div>
      </div>
    );
  }
}
